    # Loading of data
    def load_portfolio(self, nric):
        my_cursor.execute("SELECT * FROM oneHealth.patient WHERE patientId = %s", (nric,))
        rows = my_cursor.fetchall()
        my_cursor.execute("SELECT * FROM oneHealth.patient WHERE patientId = %s", (rows[0][5],))
        rows1 = my_cursor.fetchall()

        # Display
        self.lineEdit.setText(rows[0][1]) #fullname
        self.lineEdit_3.setText(rows[0][2])#contatc
        self.lineEdit_5.setText("Male" if rows[0][7] == 1 else "Female")#gender
        self.lineEdit_7.setText(rows[0][6])#bloodType
        self.lineEdit_9.setText(rows1[0][1])#NOK name
        self.lineEdit_2.setText(rows[0][0])#NRIC
        self.lineEdit_4.setText(rows[0][4].strftime("%m/%d/%Y, %H:%M:%S"))#DOB
        if rows[0][7] == 0:
            self.lineEdit_6.setText("Yes" if rows[0][8] == 1 else "No")  # pregnancy
        else:
            self.lineEdit_6.setText("N.A")

        self.lineEdit_8.setText(rows[0][9])#nationality
        self.lineEdit_10.setText(rows1[0][2])#NOK contact
        self.patient_chronicConditionInput.appendPlainText(rows[0][3])

    def load_consultation(self,nric):
        my_cursor.execute("SELECT consultationId, dateTime FROM consultation "
                          "WHERE (patientId = %s AND datetime < NOW())",(nric,))
        rows = my_cursor.fetchall()
        for row_number, row_data in enumerate(rows):
            self.admin_borrowingTable_3.insertRow(row_number)
            self.admin_borrowingTable_3.setRowHeight(row_number,10)
            for col_num, data in enumerate(row_data):
                self.admin_borrowingTable_3.setItem(
                    row_number, col_num, QtWidgets.QTableWidgetItem(str(data))
                )

        my_cursor.execute("SELECT consultationId, dateTime FROM consultation "
                          "WHERE (patientId = %s AND datetime >= NOW())",(nric,))
        rows = my_cursor.fetchall()
        for row_number, row_data in enumerate(rows):
            self.admin_borrowingTable_2.insertRow(row_number)
            self.admin_borrowingTable_2.setRowHeight(row_number,10)
            for col_num, data in enumerate(row_data):
                self.admin_borrowingTable_2.setItem(
                    row_number, col_num, QtWidgets.QTableWidgetItem(str(data))
                )

    def load_subsidy(self,nric):
        my_cursor.execute("SELECT type,amount,startDate,endDate FROM patientsubsidy INNER JOIN subsidy "
                          "ON patientsubsidy.subsidyId = subsidy.subsidyId "
                          "WHERE patientId = %s", (nric,))
        rows = my_cursor.fetchall()
        for row_number, row_data in enumerate(rows):
            self.admin_reservationTable.insertRow(row_number)
            self.admin_reservationTable.setRowHeight(row_number,10)
            for col_num, data in enumerate(row_data):
                self.admin_reservationTable.setItem(
                    row_number, col_num, QtWidgets.QTableWidgetItem(str(data))
                )
        ## to check which are the available subsidy
        my_cursor.execute(
            "SELECT * FROM oneHealth.subsidy WHERE subsidyId NOT IN (SELECT subsidyId FROM oneHealth.patientsubsidy WHERE patientId = %s)",
            (nric,))
        rows = my_cursor.fetchall()
        for row_number, row_data in enumerate(rows):
            self.admin_reservationTable_3.insertRow(row_number)
            self.admin_reservationTable_3.setRowHeight(row_number,10)
            for col_num, data in enumerate(row_data):
                self.admin_reservationTable_3.setItem(
                    row_number, col_num, QtWidgets.QTableWidgetItem(str(data))
                )

    def load_insurance_details(self,nric):

        # Load current insurance
        my_cursor.execute("SELECT patientinsurance.insuranceId, insuranceCompany FROM patientinsurance "
                          "INNER JOIN insurance "
                          "ON patientinsurance.insuranceId = insurance.insuranceId "
                          "WHERE patientId = %s", (nric,))
        rows = my_cursor.fetchall()
        for row_number, row_data in enumerate(rows):
            self.admin_reservationTable_5.insertRow(row_number)
            self.admin_reservationTable_5.setRowHeight(row_number,10)
            for col_num, data in enumerate(row_data):
                self.admin_reservationTable_5.setItem(
                    row_number, col_num, QtWidgets.QTableWidgetItem(str(data)))

        # Load Available insurances
        my_cursor.execute('SELECT insuranceId, insuranceCompany  from insurance '
                          'WHERE insuranceId NOT IN (SELECT patientinsurance.insuranceId '
                          'FROM patientinsurance INNER JOIN insurance '
                          'ON patientinsurance.insuranceId = insurance.insuranceId WHERE patientId = %s)',
                          (nric,))
        rows = my_cursor.fetchall()
        for row_number, row_data in enumerate(rows):
            self.admin_reservationTable_4.insertRow(row_number)
            self.admin_reservationTable_4.setRowHeight(row_number,10)
            for col_num, data in enumerate(row_data):
                self.admin_reservationTable_4.setItem(
                    row_number, col_num, QtWidgets.QTableWidgetItem(str(data)))


