    def cell_clicked_consult1(self):
        indexes = self.admin_borrowingTable_3.selectionModel().selectedRows()
        for index in sorted(indexes):
            row = index.row()
            rowtext = []
            for column in range(self.admin_borrowingTable_3.columnCount()):
                if column == 1:
                    continue
                else:
                    rowtext.append(self.admin_borrowingTable_3.item(row, column).text())
            self.window = QtWidgets.QMainWindow()
            consultationDisplay(self.window,self.MainWindow,rowtext[0])
            self.MainWindow.hide()

